import { faCoffee } from '@fortawesome/free-solid-svg-icons'

function WeatherForecast() {
    return (
        <div>
            <Card style={{width: '18rem'}}>
                <Card.Img variant="top">

                </Card.Img>
                <Card.Body>
                    <Card.Title>
                        <FontAwesomeIcon icon={["far", "coffee"]}/>
                    </Card.Title>
                </Card.Body>
            </Card>
        </div>
    )

}

export default (WeatherForecast);
